import React, {Component} from 'react';

class BoxHeaderButton extends Component{
    constructor (props){
        super(props);
        this.handleClick = this.handleClick.bind(this);
    }
    handleClick = e => {
        console.log("hola");
    };


    render(){
        return(
            <button className ="BoxHeaderButton" onClick = {this.handleClick}>{this.props.rol}</button> 
        )
    }
}    

export default BoxHeaderButton;
